import React, { useEffect, useState } from "react";
import { transportAPI, transporterAPI, orderAPI } from "../services/api";

const AssignTransport = () => {
  const [orders, setOrders] = useState([]);
  const [transporters, setTransporters] = useState([]);
  const [form, setForm] = useState({});
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    loadOrders();
    loadTransporters();
  }, []);

  const loadOrders = async () => {
    const res = await orderAPI.getAll();
    setOrders(res.data);
  };

  const loadTransporters = async () => {
    const res = await transporterAPI.getAll();
    setTransporters(res.data);
  };

  const handleChange = (orderId, field, value) => {
    setForm((prev) => ({
      ...prev,
      [orderId]: { ...prev[orderId], [field]: value },
    }));
  };

  const assign = async (orderId) => {
    const data = form[orderId];
    if (!data || !data.transporterId || !data.vehicleNo || !data.driverName)
      return alert("‚ö†Ô∏è Please fill all details.");

    setLoading(true);
    try {
      await transportAPI.assignTransport(orderId, {
        vehicleNo: data.vehicleNo,
        driverName: data.driverName,
        contact: data.contact,
        transporter: { id: data.transporterId },
      });
      alert("‚úÖ Transport assigned!");
    } catch {
      alert("‚ùå Failed to assign transport.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h2>üì¶ Admin Transport Assignment</h2>
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Order ID</th>
            <th>Status</th>
            <th>Transporter</th>
            <th>Vehicle</th>
            <th>Driver</th>
            <th>Contact</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {orders.map((o) => (
            <tr key={o.id}>
              <td>{o.id}</td>
              <td>{o.status}</td>
              <td>
                <select
                  onChange={(e) =>
                    handleChange(o.id, "transporterId", e.target.value)
                  }
                >
                  <option value="">Select</option>
                  {transporters.map((t) => (
                    <option key={t.id} value={t.id}>
                      {t.name}
                    </option>
                  ))}
                </select>
              </td>
              <td>
                <input
                  placeholder="Vehicle No"
                  onChange={(e) =>
                    handleChange(o.id, "vehicleNo", e.target.value)
                  }
                />
              </td>
              <td>
                <input
                  placeholder="Driver Name"
                  onChange={(e) =>
                    handleChange(o.id, "driverName", e.target.value)
                  }
                />
              </td>
              <td>
                <input
                  placeholder="Contact"
                  onChange={(e) =>
                    handleChange(o.id, "contact", e.target.value)
                  }
                />
              </td>
              <td>
                <button onClick={() => assign(o.id)} disabled={loading}>
                  {loading ? "Assigning..." : "Assign"}
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AssignTransport;
